window.bookSummaryJSON = "<p><b>Three men. Two brothers. One failing station.</b></p> <p>When Edgar Vagrant down checks Verkol Kondur’s mining barge, Kondur gets swept up in station politics in spite of his best efforts to avoid them. When Edgar pushes his elder son, Malachai, into working on the station’s freighter, Malachai decides to take matters into his own hands.</p> <p>With Malachai gone, his brother Zachary gets to pick up the pieces of a management structure that he had no hand in making, no authority to control, and no wish to continue. When mysterious dark sun graffiti appears all over the station, it seems clear that the situation has attracted someone’s attention. The question is whose?</p>"; 
